import React from "react";
import styled from "styled-components";
import Footer from "../Footer";
import Logo from "../../Images/Logo";
import Dragon from "../../Images/DragonIcon";
import DragonIcon from "../../Images/DragonIcon";

const Container = styled.div`
  background-color: #252525;
  width: 99vw;
  height: calc(100vh - 75px);
  text-align: center;
  margin: 0 auto;

  @media (max-width: 600px) {
    width: 100vw;
  }
`;

const OutlineBackgroundContainer = styled.div``;

const LoginBox = styled.div`
  width: 90vw;
  max-width: 600px;
  min-height: 375px;
  height: 50vh;
  max-height: 450px;
  margin: 0 auto;
  text-align: center;
  background-color: rgba(255, 255, 255, 0.8);
  border: 4px solid #fff;
  border-radius: 5px;
  position: absolute;
  top: 50vh;
  left: 50vw;
  transform: translate(-50%, -60%);

  @media (max-width: 600px) {
    margin-left: 7px;
  }
`;

const StyledLogo = styled(Logo)`
  width: 275px;
  margin-top: 50px;
`;

const Login = () => {
  return (
    <div>
      <Container>
        <OutlineBackgroundContainer>
          <DragonIcon />
        </OutlineBackgroundContainer>
        <LoginBox>
          <StyledLogo />
        </LoginBox>
      </Container>
      <Footer />
    </div>
  );
};

export default Login;
